import '../node_modules/bootstrap/dist/css/bootstrap.css';
import axios from 'axios';
import { useEffect, useState } from "react"; 

function InstituteRegForm(){
  const [name, setName] = useState("");
  const [address, setAddress] = useState("");
  const [city, setCity] = useState("");
  const [state1, setState1] = useState("");
  const [pincode, setPincode] = useState("");
  const [university, setUniversity] = useState("");
  const [status, setStatus] = useState("");
  const [id, setId] = useState("");
  const [data, setData] = useState("");



  async function save(event){
    event.preventDefault();
    try {
        await axios.post("http://192.168.144.185:8080/institute",{
        id:id,
        address:address,
        city:city,
        name:name,
        pincode:pincode,
        state:state1,
        status:status,
        university:university


    });
    alert("Institute registration sccessful")

    } catch (error) {
      alert("Institute registration failed")
    }
  }

  const url="http//192.168.144.185:8080/course";

  // const fetchInfo = ()=>{
  //   return axios.get(url).then((response)=>response.json()).then((data)=>setData(data));
  // }
  // useEffect(()=>{
  //   fetchInfo();
  // },[])



    return(


        <div className="container" >
            <div className="py-5 text-center">

              <h2>Institute Registration form</h2>
              <p className="lead"></p>
            </div>

            <div className="row">




              <div className="col-md-12 order-md-3">
                <h4 className="mb-3"></h4>

                <div className="row">
                    <div className="col-md-4 mb-3">
                      <label for="name">Institute Id*</label>
